// Visit Amazon homepage
cy.visit(Cypress.env("amazonBaseUrl"));
// Verify Amazon logo is visible
_homePage.homePage.getAmazonLogo();
_homePage.homePage.dismissDeliverToToastIfVisible();
_homePage.homePage.enterSearchKeyword('chair');
_homePage.homePage.clickSearchButton();
// Sort search results by Price: Low to High
_searchResultPage.searchResultPage.sortByPriceHightToLow();
// Get first product name and price in search results
_searchResultPage.searchResultPage.getFirstProductNameInSearchResults().then(text => {
  productName = text.trim();
  expect(productName).not.to.be.empty;
  cy.log(`Product Name: ${productName}`);
});
_searchResultPage.searchResultPage.getFirstProductPriceInSearchResults().then(text => {
  productPrice = text.trim().replace(/(\$|IDR|Rp|\s)/g, '');
  expect(productPrice).not.to.be.empty;
  cy.log(`Product Price: ${productPrice}`);
});
// Add first product to cart
_searchResultPage.searchResultPage.clickAddToCartButton();
// Go to cart and verify cart count
_homePage.homePage.clickCartMenu();
_homePage.homePage.getCartCount().then(cartCount => {
  expect(cartCount).to.equal('1');
});
// Verify product details in cart
_cartPage.cartPage.getCartTitle();
_cartPage.cartPage.getFirstProductNameInCart(productName).then(nameInCart => {
  expect(nameInCart).to.contain(productName);
});
_cartPage.cartPage.getFirstProductPriceInCart(productPrice).then(priceInCart => {
  priceInCart = priceInCart.trim().replace(/(\$|IDR|Rp|\s)/g, '');
  expect(priceInCart).to.equal(productPrice);
});
_cartPage.cartPage.getFirstProductQtyInCart().then(qty => {
  expect(qty).to.equal('1');
});
